let live_app = '598957e33647358022a3327d'; /* app unique key**/
let visitor_key = ''; /* visitor key **/
let hidVal = {};

let fxns = (function () {
  /* -- Get Visitor Key -- **/
  function generateVisitor() {
    /*  post data */
    let post_data = {
      appId: live_app,
      hidVal: hidVal,
      key: visitor_key,
      utm_param: utm_param
    };

    /*  call for generate unique key */
    $.ajax({
      url: "https://api.outgrow.co/api/v1/analytic/visitor_key",
      type: "post",
      contentType: "application/json; charset=utf-8",
      dataType: "json",
      data: JSON.stringify(post_data),
      success: (response) => {
        visitor_key = response.data.key;
        calculateFormula();
      },
      error: function (jqXHR, textStatus, errorThrown) {
        console.log('Error');
      }
    });
  }
  /* -- Get Visitor Key End -- **/

  /* -- save question -- **/
  function save_stats(item, value) {
    /*  post data */
    let slider_data = {
      appId: live_app,
      item: {
        _id: item,
        type: 'slider',
        props: {
          currentValue: value,
          currentLabel: value
        }
      },
      key: visitor_key,
      unsavedArray: []
    };
    /*  call for save stats */
    $.ajax({
      url: "https://api.outgrow.co/api/v1/analytic/save_stats",
      type: "post",
      contentType: "application/json; charset=utf-8",
      dataType: "json",
      data: JSON.stringify(slider_data),
      success: () => {
      },
      error: function (jqXHR, textStatus, errorThrown) {
        console.log('Error');
      }
    });
  }
  /* -- save question end-- **/

  /* -- save result -- **/
  function save_result() {
    let formulas = [];
    /*  get all result value */
    $('.result-value p').each(function () {
      formulas.push({
        _id: $(this).data('result'),
        value: $(this).text(),
        units: {
          preValue: '',
          postValue: ''
        }
      });
    });

    /*  post data */
    let slider_data = {
      appId: live_app,
      formula: formulas,
      key: visitor_key,
    };
    /*  call for save result */
    $.ajax({
      url: "https://api.outgrow.co/api/v1/analytic/save_result",
      type: "post",
      contentType: "application/json; charset=utf-8",
      dataType: "json",
      data: JSON.stringify(slider_data),
      success: () => {
      },
      error: function (jqXHR, textStatus, errorThrown) {
        console.log('Error');
      }
    });
  }
  /* -- save question end-- **/
  function rangeSliderInit() {
    /* initialize range sliders **/
    $(".js-range-slider").ionRangeSlider({
      type: "single",
      keyboard: true,
      grid: true,
      onFinish: function (data) {
        /* save stats */
        $(data.input.data('id')).val(addCommas(data.from));
        save_stats(data.input.data('question'), data.from);
        calculateFormula();
      },
      prettify: function (num, fixed) {
        if (num === null) { return null; } // terminate early
        if (num === 0) { return '0'; } // terminate early
        fixed = (!fixed || fixed < 0) ? 0 : fixed; // number of decimal places to show
        var b = (num).toPrecision(2).split("e"), // get power
          k = b.length === 1 ? 0 : Math.floor(Math.min(b[1].slice(1), 14) / 3), // floor at decimals, ceiling at trillions
          c = k < 1 ? num.toFixed(0 + fixed) : (num / Math.pow(10, k * 3)).toFixed(1 + fixed), // divide by power
          d = c < 0 ? c : Math.abs(c), // enforce -0 is 0
          e = d + ['', 'K', 'M', 'B', 'T'][k]; // append power
        return e;
      }
    });
  }
  /* initialize range sliders end **/

  /** calculate formula */
  function calculateFormula() {
    let questions = $(".js-range-slider");
    $('.result-value p').each(function () {
      let formula = $(this).data('formula');
      /** replace formula with values */
      formula = formula.replace(/(Q[\d]+)/g, (match) => {
        let index = Number(match.split(/[Q]/)[1]);
        return questions[index - 1].value ? questions[index - 1].value : match;
      });
      /** replace formula with values */
      /*** calculate values by pass to math lib */
      formula = Math.round(math.eval(formula));
      $(this).text(addCommas(formula));
    });

    /* save result */
    save_result();
  }
  /** calculate formula end */


  return {
    generateVisitor: function () {
      generateVisitor();
    },
    save_item: function (item, value) {
      save_stats(item, value);
    },
    save_result: function () {
      save_result();
    },
    initSlider: function () {
      rangeSliderInit();
    },
    calculate: function () {
      calculateFormula();
    }
  };
})();

$(document).ready(function () {
  resultScroll();
  fxns.generateVisitor(); /*  unique key For User */
  fxns.initSlider();
  //Inputs
  $('.slider-input').keyup(function (event) {
    if (event.keyCode == 13) {
      var sliderEle = $(this).parent().parent().find('.js-range-slider');
      event.target.blur();
    } else {
      event.target.value = addCommas(event.target.value.replace(/,/g, ''));
    }
  });
  $('.slider-input').focusout(function (event) {
    let val = event.target.value.replace(/,/g, '');
    let sliderEle = $(this).parent().parent().find('.js-range-slider');
    let max = sliderEle.attr('data-max');
    let min = sliderEle.attr('data-min')
    if (parseFloat(val) > parseFloat(max))
      val = max;
    else if ((parseFloat(val) < parseFloat(min)) || isNaN(val))
      val = min;	
	event.target.value	=	addCommas(val);
    sliderEle.data('ionRangeSlider').update({
      from: val
    });
    fxns.calculate();
  });
});

