// Graphs Start
function getQuesVal(quesNumer) {
  let questions = $(".js-range-slider");
  return questions[quesNumer - 1].value;
}

function getResultVal(resultNumber) {
  let selector = '#result-' + resultNumber + '-value'
  return $(selector)[0].innerText;
}

function spliceData(data, rows, columns) {
  let datas = [];
  let isRows = rows && !isNaN(rows) && Number.isInteger(Number(rows)) && Number(rows) < data.length;
  let isColumns = columns && !isNaN(columns) && Number.isInteger(Number(columns)) && Number(columns) < data[0].length;
  if (!isRows) rows = data.length - 1;
  if (!isColumns) columns = data[0].length - 1;
  if (isRows || isColumns) {
    for (let i = 0; i <= rows; i++) {
      let theColumns = [];
      for (let j = 0; j <= columns; j++) {
        theColumns.push(data[i][j]);
      }
      datas.push(theColumns);
    }
  }
  return datas.length ? datas : data;
}

function parseGraphJSON(graphJSON) {
  return graphJSON.map((row) => {
    return row.map((val) => {
      if (val) {
        return val.toString().replace(/(Q_[\d]+)/g, (matchQues) => {
          let quesNumber = Number(matchQues.split(/[Q_]/)[2]);
          let currentValue = getQuesVal(quesNumber);
          return currentValue ? currentValue : 0;
        }).toString().replace(/(R_[\d]+)/g, (matchRes) => {
          let resultNumber = Number(matchRes.split(/[R_]/)[2]);
          let currentValue = getResultVal(resultNumber);
          return currentValue ? currentValue : 0;
        });
      }
    });
  });
}

function getGraphDataSet(graph) {
  let dataSet = [];
  let spliceJSON = spliceData(JSON.parse(graph.rawJSON), graph.rows, graph.columns);
  let json = parseGraphJSON(spliceJSON);
  let container = document.getElementById('temp-graph-table');
  let hot = new Handsontable(container, {
    data: json,
    rowHeaders: true,
    colHeaders: true,
    formulas: true
  });
  let data = hot.getData();
  data.forEach((row, index) => {
    if (index) {  //to skip the first row
      let values = [];
      row.splice(1).forEach((val, itemIndex) => {
        let yData = isNaN(val) ? 0 : Number(val);
        values.push({
          name: data[0][itemIndex + 1],
          y: yData,
          color: (graph.type == 'pie' && !graph.isDefaultColor) ? '' : (graph.isDefaultColor ? graph.defaultColor : graph.colors[index - 1])
        });
      });
      //The if is used so that we take in only first row in case of PIE Charts
      if (graph.type != 'pie' || index == 1) {
        dataSet.push({ data: values, name: row[0], color: graph.isDefaultColor ? graph.defaultColor : graph.colors[index - 1] });
      }
    }
  });
  return dataSet;
}

