function tableInit() {
  if (tableNow.rawJSON) {
    let spliceJSON = spliceData(JSON.parse(tableNow.rawJSON), tableNow.rows, tableNow.columns);
    let json = parseGraphJSON(spliceJSON);
    let container = document.getElementById('og-table-excel');
    setTimeout(() => {
      let hot = new Handsontable(container, {
        data: json,
        formulas: true
      });
      createTableData(addCommasTable(hot.getData()));
    }, 50);
  }
}

function addCommasTable(table) {
  if (table)
    return table.map((row, index) => {
      if (index)
        return row.map((cell, i) => {
          if (i)
            return addCommas(cell);
          return cell;
        });
      return row;
    });
}

function createTableData(data) {
  let bodyData = '';
  let headData = '';
  data.forEach((row, index) => {
    if (!index) {  //0 index tableHead
      row.forEach((column) => {
        headData += ('<th>' + column + '</th>')
      })
    } else {        // for bodyData
      bodyData += '<tr class="light">';
      row.forEach((column) => {
        bodyData += ('<td>' + column + '</td>')
      })
      bodyData += '</tr>';
    }
  });
  $('#table-final-head').html('<tr>' + headData + '</tr>');
  $('#table-final-body').html(bodyData);
}